import React from "react";
import ContactUsContent from '../components/contact-us';
import Banner from "../components/hero";

import { gql, useQuery } from '@apollo/client'

const query = gql`
query{  
  contactUsPage{
    hero{
      title
      subTitle
      background{
        url
      }
    }
    contactUsSectionTitle
    contactUsSectionSubTitle
    officesSectionTitle
    officesSectionSubTitle
  }
  addresses{
    id
    name
    openHours{
      header
      content{
        title
        description
      }
    }
    contactCenter{
      header
      content{
        title
        description
      }
    }
  }
}
`

const Contactus = () => {
  const { data, loading } = useQuery(query)
  if (loading)
    return <Loading/>
  return (
    <>
      <Banner hero={data.contactUsPage.hero} children={null}/>
      <ContactUsContent officeTitle={data.contactUsPageofficesSectionTitle}
      officeSubTitle={data.contactUsPageofficesSectionSubTitle}
      contactUsTitle={data.contactUsPagecontactUsSectionTitle}
      contactUsSubTitle={data.contactUsPagecontactUsSectionSubTitle} addresses={data.addresses}/>
    </>
  )

};

export default Contactus;
